import React from 'react'
import axios from "axios";
import './Search.css'


class Search extends React.Component{


    constructor() {
        super();

        this.state = {
          dt: [],
          value: 0
        };
      }

      call = () => {
        var b = [];
        var self = this;
        axios
          .get("http://localhost:5000/data")
          .then((response) => {
            // handle success
            var a = JSON.stringify(response);
            a.toLowerCase()
             console.log(a)

            var separators = [
              " ",
              "\\\\n",
              "\\.",
              '\\\\',
              '\\\/',
              '\\\'',
              ",",
             '\\-',
             '\\_',

              "\\*",
              '\\\(', 
              '\\\)',
              "/",
              "[",
              "]",
              ":",
              '\\"',
              "}",
              "{",
              "@",
              "\\?",
              "\\;",
              '[0-9]',
              '>',
              '<'
            ];
            console.log(separators.join("|"));
             b = a.split(new RegExp(separators.join("|"), "g"));
             //After spliting value
            console.log(b);


            var ob= new Object()
            //making hashmap objec of words frequency
            for(var i=0;i<b.length;i++){

              if(!(b[i] in ob && b[i]!=="")){
                ob[b[i]]=1
              }
              else{
                ob[b[i]]=ob[b[i]]+1
              }

            }

            console.log(ob)
          //sorting according to their frequency

           var final= Object.entries(ob).sort((a,b) => b[1]-a[1])
           console.log("my final result:",final);
          var result=[]
           for(var i=0;i<this.state.value;i++){
             result[i]=final[i]
           }
           self.setState({
             dt:result
           })

          })
          .catch(function (error) {
            // handle error
            console.log(error);
          })
          .finally(function () {
            // always executed
          });
      };

      inputHandler=(e)=>{

          this.setState({
            value:e.target.value
          })


          console.log(this.state.value)
      }

    render(){


        return (

            <div className="bd">
                <center>

                <div>
                <input className="searchbar" type="text"  placeholder="Enter the number..... " onChange={this.inputHandler} />

                <button className="bts" onClick={() => this.call()}>submit</button>
                </div>


                </center>
               <div> 
                   {
                     this.state.dt.map(data=>{
                       return <p> {data.key}</p>
                     })
                   }
                </div>




            </div>
        )
    }
}


export default Search
